const Result = props => {
  return (
    <>
      <p>Date: {props.date}</p>
      <p>Home or Away: {props.homeMatch}</p>
      <p>Opponent: {props.opponent}</p>
      <p>
        Score: {props.ourScore} - {props.opponentScore}
      </p>
    </>
  );
};

export default Result;
